import React from 'react';
import logo from './logo.svg';
import './App.css';
import Calendar from './calendar'

var NavBar = React.createClass({
  render() {
    return (
      <nav class="navbar navbar-inverse navbar-fixed-top">
        <div class="container-fluid">
          <div class="navbar-header">
            <button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1" aria-expanded="false">
              <span class="sr-only">Toggle navigation</span>
              <span class="icon-bar"></span>
              <span class="icon-bar"></span>
              <span class="icon-bar"></span>
            </button>
            <a class="navbar-brand" href="#">HandsOn Connect</a>
          </div>

          <div class="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
            <ul class="nav navbar-nav">
              <li class="active"><a href="#"><i class="fa fa-tachometer" aria-hidden="true"></i> Calendar <span class="sr-only">(current)</span></a></li>
              <li><a href="#"><i class="fa fa-cog" aria-hidden="true"></i> Settings</a></li>
              <li><a href="#"><i class="fa fa-user" aria-hidden="true"></i> Profile</a></li>
              <li><a href="#"><i class="fa fa-question-circle" aria-hidden="true"></i>Help</a></li>
            </ul>
            <ul class="nav navbar-nav navbar-right">
              <li><a href="#"><i class="fa fa-user-plus" aria-hidden="true"></i> Switch User</a></li>
              <li><a href="#"><i class="fa fa-files-o" aria-hidden="true"></i> About Us</a></li>
            </ul>
          </div>
        </div>
        </nav>
    )
  }
});


const Input = (props) => (
  <input type="file" name="file-input" multiple {...props} />
)

const App = () => {
  const onSubmit = (e) => {
    e.preventDefault()
  }

  const onChange = (e) => {
    console.log(e.target.files)
  }

  return (
    <div className="App">
      <Navbar />
      <form className="form" onSubmit={onSubmit}>
        <div>
          <Input onChange={onChange} />
          <button type="submit">Submit</button>
        </div>
      </form>
      <Calendar/>
    </div>
  )
}

export default App
